import React from 'react';
import './App.css';
import Header from './components/Header';
import Banner from './components/Banner';
import Cards from './components/Cards';
import Login from './components/Login';

function App() {
  // For testing login page, you can conditionally render
  const showLogin = false; // Set to true to see login page

  return (
    <div className="App">
      {showLogin ? (
        <Login />
      ) : (
        <>
          <Header />
          <Banner />
          <Cards />
        </>
      )}
    </div>
  );
}

export default App;
